import React from 'react';
import {Button, Card, CardContent, Typography} from '@material-ui/core';
import {makeStyles} from '@material-ui/styles';
import {FuseAnimate, FuseAnimateGroup} from '@fuse';
import clsx from 'clsx';

const useStyles = makeStyles(theme => ({
    header: {
        height    : 200,
        background: 'linear-gradient(to right, ' + theme.palette.primary.dark + ' 0%, ' + theme.palette.primary.main + ' 100%)',
        color     : theme.palette.primary.contrastText
    },
    badge : {
        backgroundColor: theme.palette.error.main,
        color          : theme.palette.getContrastText(theme.palette.error.main)
    },
    price : {
        backgroundColor: theme.palette.primary[600],
        color          : theme.palette.getContrastText(theme.palette.primary[600])
    }
}));

export default function CourseDet(props)
{
    const classes = useStyles();

    return (
        <div>

            <div className="-mt-192">

                <div className="w-full max-w-2xl mx-auto">

                    <FuseAnimateGroup
                        enter={{
                            animation: "transition.slideUpBigIn"
                        }}
                        className="flex items-center justify-center flex-wrap"
                    >

                        <div className="w-full max-w-320 sm:w-1/3 p-12">

                            <Card className="relative" raised>
                                <div className="p-32 text-center">
                                    <Typography className="text-32">
                                        Enrolments
                                    </Typography>
                                </div>

                                <CardContent className="text-center p-0">

                                    <div className={clsx(classes.price, "flex items-end justify-center py-16 px-32")}>
                                        <div className="flex justify-center">
                                            <Typography color="inherit" className="text-32 ml-4 mr-8 font-light leading-none">75 Enrolments</Typography>
                                        </div>
                                    </div>

                                    <div className="flex flex-col p-32 text-30">
                                        <Typography color="textSecondary" className="mb-16 text-30">
                                            45 Credits
                                        </Typography>
                                        <Typography color="textSecondary" className="mb-16">
                                            30 Audits
                                        </Typography>
                                        <Typography color="textSecondary" className="mb-16">
                                           Undergraduates=50
                                        </Typography>
                                        <Typography color="textSecondary">
                                            PostGraduates=25
                                        </Typography>
                                    </div>
                                </CardContent>

                            </Card>
                        </div>

                    </FuseAnimateGroup>

                </div>
            </div>
        </div>
    );
}
